import "./homePage.css"
import React, { useEffect, useState } from "react";


export default function HomePage() {

    //An of raids to display to the home page
    const [width, setWidth] = useState(0);


    //Use effect hock sets the intial condition?
    useEffect(() => {
        document.title = `The width is:${width}`;
    });


    return (
        <div>
            <h1>Lost Ark</h1>
            <h2>Popular Raids</h2>

            <h2>Popular Pages</h2>

            <p>You clicked {width} times</p>
            {/*Creates a function which increments count by 1 using set state*/}
            <button onClick={() => setWidth(innerWidth)}>
                Click me
            </button>
        </div>
    );
}
